import React from 'react';
import { compose } from 'recompose';

import { Grid, Image, Icon } from 'semantic-ui-react'
import { withAuthorization, withEmailVerification } from '../Session';

import './index.scss';


const CategoryPage = () => (
	<Grid>
		<Grid.Row>
			<Grid.Column>
				<button id="block">
					College of Engineering
				</button>
			</Grid.Column>
			<Grid.Column>
				<button id="block">
					College of Business
				</button>
			</Grid.Column>
		</Grid.Row>
		<Grid.Row>
			<Grid.Column>
				<button id="block">
					College of Liberal Arts and Science
				</button>
			</Grid.Column>
			<Grid.Column>
				<button id="block">
					College of Law
				</button>
			</Grid.Column>
		</Grid.Row>
	</Grid>
)

export default CategoryPage;

// const condition = authUser => !!authUser;

